  \"2016-03-17T20:52:13.161266\",\n\t\"name\": \"iowa-lakes-information-system\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Iowa Lakes Information System provides
  the Iowa Department of Natural Resources with lake monitoring data, including biological,
  chemical, and limnological analyses on Iowau2019s most important lakes. These monitoring
  data have many uses (e.g., lakes classification for restoration, water quality evaluation,
  monitoring).rnrnThe mini-report allows the public to compile and print personalized
  summary reports for 130 of Iowau2019s principle recreational lakes. Searching for
  your lake of interest is organized alphabetically and done within three different
  search mechanisms (Lake by Index, Lake by Search, and Lake by County).\",\n\t\"license_title\":
